import React from "react";
import SearchBar from "./SearchBar"
import { Link } from "react-router-dom"

export default function Nav (props) {
    return (
        <>
        <SearchBar onSearch={props.onSearch} randomChar={props.randomChar} />
        <button>About</button>
        </>
    )
}
